BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" serial NOT NULL PRIMARY KEY , "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" timestamp NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" serial NOT NULL PRIMARY KEY , "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" serial NOT NULL PRIMARY KEY , "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" serial NOT NULL PRIMARY KEY , "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" serial NOT NULL PRIMARY KEY , "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auctions_auctioncategories" ("id" serial NOT NULL PRIMARY KEY , "category" varchar(64) NOT NULL);
CREATE TABLE IF NOT EXISTS "auctions_user" ("id" serial NOT NULL PRIMARY KEY , "password" varchar(128) NOT NULL, "last_login" timestamp NULL, "is_superuser" integer NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" integer NOT NULL, "is_active" integer NOT NULL, "date_joined" timestamp NOT NULL);
CREATE TABLE IF NOT EXISTS "auctions_user_groups" ("id" serial NOT NULL PRIMARY KEY , "user_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auctions_user_user_permissions" ("id" serial NOT NULL PRIMARY KEY , "user_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" serial NOT NULL PRIMARY KEY , "action_time" timestamp NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" timestamp NOT NULL);
CREATE TABLE IF NOT EXISTS "auctions_listing" ("id" serial NOT NULL PRIMARY KEY , "title" varchar(64) NOT NULL, "desc" text NULL, "start_bid" integer NOT NULL, "status" integer NOT NULL, "category_id" integer NULL REFERENCES "auctions_auctioncategories" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED, "image" varchar(200) NULL);
CREATE TABLE IF NOT EXISTS "auctions_comment" ("id" serial NOT NULL PRIMARY KEY , "comment" varchar(1500) NOT NULL, "user_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED, "listing_id" integer NULL REFERENCES "auctions_listing" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auctions_bid" ("id" serial NOT NULL PRIMARY KEY , "amount" integer NOT NULL, "user_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED, "listing_id" integer NOT NULL REFERENCES "auctions_listing" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auctions_watchlist" ("id" serial NOT NULL PRIMARY KEY , "listing_id" integer NULL REFERENCES "auctions_listing" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED);
